const getWinColor = (d, key = 'votes') => {
    if (d.result[0] &&
        d.result[0][key] === 0 &&
        d.result[1] &&
        d.result[1][key] === 0) {
        return "#eeeeee"
    }
    let winner = d.result.reduce((acc, e) => e[key] > acc[key] ? e : acc)
    return partyScale.domain().includes(winner.party)
        ? partyScale(winner.party)
        : "#dddddd";
}

